import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>CRUD app</h1>
      <div className="inputs">
          <label>Name</label>
          <input type="text" name="Name" />
          <label>Class</label>
          <input type="text" name="class" />
      </div>
    </div>
  );
}

export default App;
